def my_func(s: str) -> str:
    if '-' in s:
        parts = s.split('-')
        s = parts[0] + ''.join(word.capitalize() for word in parts[1:])
    return s

def my_func(s):
    parts = s.split(' ')
    for i in range(len(parts)):
        sub_parts = parts[i].split('-')
        for j in range(1, len(sub_parts)):
            if sub_parts[j]:
